import React from 'react';

const SearchBar = ({ onSearch }) => {
    return (
        <div>
            <input
                type="text"
                placeholder="Search for products..."
                onChange={(e) => onSearch(e.target.value)}
            />
        </div>
    );
};

export default SearchBar;
